import React from "react";
//Import Icons
import serviceCops from "../img/truck.gif";
import neptune from "../img/neptune.png";

import schoolpay from "../img/schoolpay.png";
import gulapay from "../img/gulapay.png";
import seepug from "../img/seepug.png";
import wefarm from "../img/wefarm.png";
//Styles
import { About, DescriptionVegetables, Image } from "../styles";
import styled from "styled-components";
import { scrollReveal } from "../animation";
import { useScroll } from "./useScroll";

const Vegetables = () => {
    const [element, controls] = useScroll();
    return (
        <VegetablesContainer
            variants={scrollReveal}
            animate={controls}
            initial="hidden"
            ref={element}
        >
            <DescriptionVegetables>
                <Cards>
                    <Card>
                        <div className="icon">
                            <div className="inner_circle">
                                <Image>
                                    <img src={serviceCops} alt="guy with a camera" />
                                </Image>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Always Fresh</h3>
                            <span>Product well package</span>
                        </div>
                    </Card>

                    <Card>
                        <div className="icon ic_2">
                            <div className="inner_circle ">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <span>Quality Products</span>
                            <h3 class="heading">Superior Quality</h3>
                        </div>
                    </Card>

                    <Card>
                        <div className="icon">
                            <div className="inner_circle">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Free Shipping</h3>
                            <span>On order over $100</span>
                        </div>
                    </Card>

                    <Card>
                        <div className="icon icon_c">
                            <div className="inner_circle inner_last">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Support</h3>
                            <span>24/7 Support</span>
                        </div>
                    </Card>

                    <Card>
                        <div className="icon">
                            <div className="inner_circle">
                                <Image>
                                    <img src={serviceCops} alt="guy with a camera" />
                                </Image>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Always Fresh</h3>
                            <span>Product well package</span>
                        </div>
                    </Card>

                    <Card>
                        <div className="icon ic_2">
                            <div className="inner_circle ">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <span>Quality Products</span>
                            <h3 class="heading">Superior Quality</h3>
                        </div>
                    </Card>


                </Cards>
                <Cards>
                    <Card>
                        <div className="icon">
                            <div className="inner_circle">
                                <Image>
                                    <img src={serviceCops} alt="guy with a camera" />
                                </Image>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Always Fresh</h3>
                            <span>Product well package</span>
                        </div>
                    </Card>
                    <Card>
                        <div className="icon ic_2">
                            <div className="inner_circle ">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <span>Quality Products</span>
                            <h3 class="heading">Superior Quality</h3>
                        </div>
                    </Card>
                    <Card>
                        <div className="icon">
                            <div className="inner_circle">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Free Shipping</h3>
                            <span>On order over $100</span>
                        </div>
                    </Card>
                    <Card>
                        <div className="icon icon_c">
                            <div className="inner_circle inner_last">
                                <i class="uil uil-truck"></i>
                            </div>
                        </div>
                        <div class="media-body">
                            <h3 class="heading">Support</h3>
                            <span>24/7 Support</span>
                        </div>
                    </Card>
                </Cards>
            </DescriptionVegetables>
        </VegetablesContainer>
    );
};

const VegetablesContainer = styled(About)`
  text-align: center;
  background: white;
  height: 100%;

  p {
    width: 70%;
    padding: 2rem 0rem 4rem 0rem;
  }
`;

const Cards = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-items: center;
  justify-content: space-around;
  width: 70%;
  margin: 0 auto;

  @media (max-width: 1300px) {
    justify-content: center;
